package swa.manage.entity;import java.io.Serializable;import java.util.Date;/** * StaffRecord:人员预定记录表 * Created by jinyan.cao on 2017-07-03 17:47:53 */public class StaffRecord implements Serializable {    private static final long serialVersionUID = 1969034612439931602L;    /**     * 自增主键     */    private Long id;    /**     * 预定日期     */    private Date date;    /**     * 预定开始时间     */    private Date startTime;    /**     * 预定结束时间     */    private Date endTime;    /**     * 编码:layer-pid     */    private String encode;    /**     * 是否已取消：0-取消，1-未取消     */    private Integer isvalid;    /**     * 预订人姓名     */    private String staffName;    /**     * 预定用途     */    private String comment;    /**     * 创建时间     */    private Date createTime;    /**     * 更新时间     */    private Date updateTime;    public Long getId() {        return this.id;    }    public void setId(Long id) {        this.id = id;    }    public Date getDate() {        return this.date;    }    public void setDate(Date date) {        this.date = date;    }    public Date getStartTime() {        return this.startTime;    }    public void setStartTime(Date startTime) {        this.startTime = startTime;    }    public Date getEndTime() {        return this.endTime;    }    public void setEndTime(Date endTime) {        this.endTime = endTime;    }    public String getEncode() {        return this.encode;    }    public void setEncode(String encode) {        this.encode = encode;    }    public Integer getIsvalid() {        return this.isvalid;    }    public void setIsvalid(Integer isvalid) {        this.isvalid = isvalid;    }    public String getStaffName() {        return this.staffName;    }    public void setStaffName(String staffName) {        this.staffName = staffName;    }    public String getComment() {        return this.comment;    }    public void setComment(String comment) {        this.comment = comment;    }    public Date getCreateTime() {        return this.createTime;    }    public void setCreateTime(Date createTime) {        this.createTime = createTime;    }    public Date getUpdateTime() {        return this.updateTime;    }    public void setUpdateTime(Date updateTime) {        this.updateTime = updateTime;    }}